import React, { useState } from "react";
import Layout from '../core/Layout';


const Signup = () => {

  return (
    <Layout title="Sign Up Page" description="Sign Up to React E-Commerce App">
      {showSuccess()}
      {showError()}
      { signUpForm() }
      {JSON.stringify(values)}
    </Layout>
  )
};

export default Signup;
